export function crearDocente(info) {
  return {
    type: "CREAR_DOCENTE",
    payload: info,
  };
}

export function modificarDocente(info) {
  return {
    type: "MODIFICAR_DOCENTE",
    payload: info,
  };
}

export function borrarDocente(info) {
  return {
    type: "BORRAR_DOCENTE",
    payload: info,
  };
}

export function traerDocentes(info) {
  return {
    type: "TRAER_DOCENTES",
    payload: info,
  };
}
